Biografie:
Geboren am 2. Oktober 1983;

 römisch-katholisch; ledig.
2003 Abitur am Ehrenbürg Gymnasium Forchheim; 2003 bis 2010 Studium der Politikwissenschaft an der Universität Bamberg; 2010 bis 2013 wissenschaftliche Mitarbeiterin im Wahlkreisbüro von MdB Uwe Kekeritz in Fürth; seit 2013 Mitarbeiterin in der Abteilung Bürgerenergie, NATURSTROM AG.2009 Listen- und Direktkandidatin für den Deutschen Bundestag (Platz 15); 2013 Listenkandidatin für den Deutschen Bundestag (Platz 13).2005 bis 2006 studentische Senatorin an der Universität Bamberg; seit 2008 Mitglied des Forchheimer Kreistags; seit 2012 Mitglied des erweiterten Landesvorstandes; seit 2014 Sprecherin Landesarbeitskreis Frauen; seit 2014 Mitglied Vorstand Bürgerenergie Bayern; seit 2016 Sprecherin Bezirk Oberfranken; seit 2016 Sprecherin Landesarbeitskreis Energie.Helene-Weber Preisträgerin 2015 (Auszeichnung für kommunalpolitisches Engagement durch Bundesfrauenministerin Manuela Schwesig).Mitgliedschaften: Terre des Femmes, Bund Naturschutz, Bürgerenergie Bayern, Verein Nationalpark Nordsteigerwald, Energie- und Klimaallianz Forchheim, Bürgerinitiative pro Wiesenttal ohne Ostspange.
